// HasCart applies the HasEdge predicate on the "cart" edge.
func HasCart() predicate.CartLineItems {
	return predicate.CartLineItems(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, CartTable, CartColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasCartWith applies the HasEdge predicate on the "cart" edge with a given conditions (other predicates).
func HasCartWith(preds ...predicate.Cart) predicate.CartLineItems {
	return predicate.CartLineItems(func(s *sql.Selector) {
		step := newCartStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CartLineItems) predicate.CartLineItems {
	return predicate.CartLineItems(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CartLineItems) predicate.CartLineItems {
	return predicate.CartLineItems(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CartLineItems) predicate.CartLineItems {
	return predicate.CartLineItems(sql.NotPredicates(p))
}
